import React, { useState, useEffect } from "react";
import axios from "axios";
import { Link } from "react-router-dom";
import {
  Button,
  Container,
  FormControl,
  Grid,
  TextField,
  Typography,
} from "@mui/material";
import { Car } from "../types";

const API_URL = "http://localhost:8080/cars";

const CarList = (): JSX.Element => {
  const [cars, setCars] = useState<Car[]>([]);

  useEffect(() => {
    fetchCars();
  }, []);

  const fetchCars = async () => {
    try {
      const response = await axios.get<Car[]>(API_URL);
      setCars(response.data);
    } catch (error) {
      console.error("Error fetching cars:", error);
    }
  };

  return (
    // <Container>
    <Grid container rowGap={3} columnSpacing={{ xs: 1, sm: 2, md: 3 }}>
      <Grid xs={4} md={8}>
        <Typography variant="h4">Car List</Typography>
        {cars.length
          ? cars.map((car) => (
              <div key={car.id}>
                <Link to={`/cars/${car.id}`}>
                  <Typography>{`${car.make} ${car.model} (${car.year})`}</Typography>
                </Link>
              </div>
            ))
          : null}
      </Grid>
      {/* <Grid
        display="flex"
        justifyContent="center"
        alignItems="center"
        rowSpacing={8}
        rowGap={3}
        columnSpacing={{ xs: 1, sm: 2, md: 3 }}
      > */}
      <FormControl sx={{ width: "25ch" }}>
        <TextField
          id="outlined-basic"
          label="Make"
          variant="standard"
          style={{ margin: 10 }}
        />
        <TextField
          id="outlined-basic"
          label="Model"
          variant="standard"
          style={{ margin: 10 }}
        />
        <TextField
          id="outlined-basic"
          label="Year"
          inputProps={{ inputMode: "numeric", pattern: "[0-9]*" }}
          variant="standard"
          style={{ margin: 10 }}
        />
      </FormControl>

      <Button variant="outlined">Submit</Button>
      {/* </Grid> */}
    </Grid>
  );
};

export default CarList;
